import React from 'react'

function WorkExperience(props) {
    return (
        <main id='workExperience'>
            <form>
                <h2> Work Experience </h2>
                <h3> Experience 1 </h3>
                <textarea 
                    name="experienceOne"
                    value={props.data.experienceOne}
                    onChange={props.handleChange}
                    placeholder='Describe the first work experience here'>
                </textarea>




                <h3> Experience 2 </h3>
                <textarea 
                    name="experienceTwo"
                    value={props.data.experienceTwo}
                    onChange={props.handleChange}
                    placeholder='Describe the second work experience here'>
                </textarea>
                <h3> Experience 3 </h3>
                <textarea 
                    name="experienceThree"
                    value={props.data.experienceThree}
                    onChange={props.handleChange}
                    placeholder='Describe the third work experience here'>
                </textarea>

                <br/>
            </form>

        </main>
    )
}

export default WorkExperience
